@diaoaks Agreed! But well designed e-learning takes that in to account.

All too often large organisations use e-learning to have auditable evidence that training has been delivered.

Delivering training is not equivalent to learning taking place, but that is lost in the tick-box culture.

@diaoaks When working in an education job, I went on a course to learn how to design e-learning packages.

The effort that goes in to even a short lesson is immense. Harder than planning face-to-face learning. And needs reviewing as often as any other teaching plan.

It’s not a quick fix!

@diaoaks E-learning done well is a phenomenally powerful educational tool.

Too often it isn’t done well.

It’s done quickly as a quick fix to tick a box.

